INSERT INTO PHARMERZPRODTEST.PRODUCTS (ID, PRODUCT, COMPOSITION, CATEGORY_ID, UPC, URL, DELETED, CREATED, UPDATED, CREATED_BY, UPDATED_BY, NOTE) VALUES ('10804A6F03394AFABBD796A96AEA8028', 'cnote', 'cnote, has been designed, keeping in mind challenges, sales teams face using paper based catalogues. cnote is digital catalogue, with inbuilt notepad and email feature.           it digitizes and automates, the complete lead generation process, by removing all the drawbacks in current process of paper based catalogue. it reduces the time to record and share the discussion over catalogue, from hours to minutes.', '2EC9F383755D4F44B75AA8F625D35B08', 'cnote', null, 0, TO_TIMESTAMP('2017-05-17 11:02:57.167000', 'YYYY-MM-DD HH24:MI:SS.FF6'), TO_TIMESTAMP('2017-05-17 11:02:57.167000', 'YYYY-MM-DD HH24:MI:SS.FF6'), 'jaideep@pharmerz.com', 'jaideep@pharmerz.com', null);
INSERT INTO PHARMERZPRODTEST.PRODUCTS (ID, PRODUCT, COMPOSITION, CATEGORY_ID, UPC, URL, DELETED, CREATED, UPDATED, CREATED_BY, UPDATED_BY, NOTE) VALUES ('6CB570608C1F4F69B87C295A02DB0371', 'e-catalogue', 'e-catalogue is electronic catalogue of product in form of android & ios app. it comes in static & dynamic form. while in static, only product list can be viewed by customer, in dynamic even customer can share trade enquiries from same app. this is best marketing tool used for cost effective promotional & communication activities .', '2EC9F383755D4F44B75AA8F625D35B08', 'ecatalogue', null, 0, TO_TIMESTAMP('2017-05-17 11:07:02.064000', 'YYYY-MM-DD HH24:MI:SS.FF6'), TO_TIMESTAMP('2017-05-17 11:07:02.064000', 'YYYY-MM-DD HH24:MI:SS.FF6'), 'jaideep@pharmerz.com', 'jaideep@pharmerz.com', null);
INSERT INTO PHARMERZPRODTEST.PRODUCTS (ID, PRODUCT, COMPOSITION, CATEGORY_ID, UPC, URL, DELETED, CREATED, UPDATED, CREATED_BY, UPDATED_BY, NOTE) VALUES ('FEC39A4543124C11BA6E4FF4121B499A', 'distributor connect', 'd​connect​ is a distributor networking product for pharmaceutical companies, where pharmaceutical companies can connect with their distributor network, update about their new offerings & distributors can place order on same platform.it helps improve sales performance by speeding up the ordering process.', '2EC9F383755D4F44B75AA8F625D35B08', 'dconnect', null, 0, TO_TIMESTAMP('2017-05-17 11:09:09.765000', 'YYYY-MM-DD HH24:MI:SS.FF6'), TO_TIMESTAMP('2017-05-17 11:09:09.765000', 'YYYY-MM-DD HH24:MI:SS.FF6'), 'jaideep@pharmerz.com', 'jaideep@pharmerz.com', null);
INSERT INTO PHARMERZPRODTEST.PRODUCTS (ID, PRODUCT, COMPOSITION, CATEGORY_ID, UPC, URL, DELETED, CREATED, UPDATED, CREATED_BY, UPDATED_BY, NOTE) VALUES ('639D47C57365478C82330B03FAFFE176', 'e-detailing', '​e-detailing​ is electronic detailing product for formulation companies, through which their sales & marketing team can carry their product catalogues in digital form to their prospects like doctor, customize their catalogue according to doctors interest, & also prepare the reports. it works even when their is no connectivity.', '2EC9F383755D4F44B75AA8F625D35B08', 'edetailing', null, 0, TO_TIMESTAMP('2017-05-17 11:11:01.436000', 'YYYY-MM-DD HH24:MI:SS.FF6'), TO_TIMESTAMP('2017-05-17 11:11:01.436000', 'YYYY-MM-DD HH24:MI:SS.FF6'), 'jaideep@pharmerz.com', 'jaideep@pharmerz.com', null);
