INSERT INTO PHARMERZPRODTEST.PRODUCTS (ID, PRODUCT, COMPOSITION, CATEGORY_ID, UPC, URL, DELETED, CREATED, UPDATED, CREATED_BY, UPDATED_BY, NOTE) VALUES ('1C753B5A9A1D447CAE15908077059F23', 'USP Potable Water Generation System', 'We study your raw water analysis report carefully and design your system according to your neccesity. This is the pre treatment plant for your PFW requirements. This plant is capable of removing the major contaminants so as to put minimal load on PFW plant. This Plant includes chlorinization, Multigrade Sand Filters, Single/Double Softners, Ultrafiltration system and Reverse osmosis System. As per the client requirements we provide PLC/ SCADA based automation. We do the complete testing of equipment and provide with quality certification. If and when needed we provide you with service.', '488CE98A0A2D4744BDF646DEB2740385', null, 'null', 0, TO_TIMESTAMP('2017-06-08 10:34:14.510000', 'YYYY-MM-DD HH24:MI:SS.FF6'), TO_TIMESTAMP('2017-06-08 10:34:14.510000', 'YYYY-MM-DD HH24:MI:SS.FF6'), 'prasoon@watermass.in', 'prasoon@watermass.in', null);
